      name_mr: '‡§™‡•Ä‡§è‡§Æ-‡§ï‡§ø‡§∏‡§æ‡§® ‡§∏‡§®‡•ç‡§Æ‡§æ‡§® ‡§®‡§ø‡§ß‡•Ä',
