      textual_explanation_mr: '‡§§‡•Å‡§Æ‡•ç‡§π‡•Ä ‡§™‡•Ä‡§è‡§Æ-‡§ï‡§ø‡§∏‡§æ‡§® ‡§∏‡§æ‡§†‡•Ä ‡§™‡•Ç‡§∞‡•ç‡§£‡§™‡§£‡•á ‡§™‡§æ‡§§‡•ç‡§∞ ‡§Ü‡§π‡§æ‡§§.',
